How to join collections in mongoose and retrieve specific fields<p>I'm working on an eCommerce platform in MERN stack. In my project, I have three schemas: User, Product, and Cart. The Cart schema references both User and Product schemas.</p>
<p>Below is my simplified schema structures:</p>
<p>cartModel.js</p>
<pre><code>const mongoose = require(&quot;mongoose&quot;);
const { Schema, model } = mongoose;

const cartSchema = new Schema(
  {
    user: { type: Schema.Types.ObjectId, ref: &quot;User&quot;, required: true },
    product: { type: Schema.Types.ObjectId, ref: &quot;Product&quot;, required: true },
    unit: { type: Number, required: true },
  },
  { timestamps: true, versionKey: false }
);

const cartModel = model(&quot;Cart&quot;, cartSchema);
module.exports = cartModel;
</code></pre>
<p>productModel.js</p>
<pre><code>const mongoose = require(&quot;mongoose&quot;);
const { Schema, model } = mongoose;

const productSchema = new Schema(
  {
    title: String,
    short_des: String,
    price: Number,
    discount_price: Number,
    image: String,
    stock: String,
    star: String,
  },
  { timestamps: true, versionKey: false }
);

const productModel = model(&quot;Product&quot;, productSchema);

module.exports = productModel;
</code></pre>
<p>userModel.js</p>
<pre><code>const mongoose = require(&quot;mongoose&quot;);
const { Schema, model } = mongoose;

const userSchema = new Schema(
  {
    name: { type: String, required: true },
    email: { type: String, unique: true, required: true },
    password: { type: String, required: true },
  },
  { timestamps: true, versionKey: false }
);

const userModel = model(&quot;User&quot;, userSchema);

module.exports = userModel;
</code></pre>
<p>My problem is, In my cart controller, I am to trying to define a query to join the Cart, User, and Product models, and trying to extract specific information but <strong>my query isn't working as expected.</strong></p>
<p>I need to extract below information for each product grouped by user:</p>
<ul>
<li>cart object ID and unit</li>
<li>user name and email</li>
<li>product title and price</li>
</ul>
<p>And I trying to return the result in an array so that I can use map method it in my react frontend to display data.</p>
<p>cartController.js</p>
<pre><code>exports.cartList = async (req, res) =&gt; {
  try {
    let userId = new mongoose.Types.ObjectId(req.user._id);

    let result = await cartModel.aggregate([
      { $match: { user: userId } },
      {
        $lookup: {
          from: &quot;users&quot;, // Name of the User model collection
          localField: &quot;user&quot;,
          foreignField: &quot;_id&quot;,
          as: &quot;userDetails&quot;,
        },
      },
      {
        $lookup: {
          from: &quot;products&quot;, // Name of the Product model collection
          localField: &quot;product&quot;,
          foreignField: &quot;_id&quot;,
          as: &quot;productDetails&quot;,
        },
      },
      {
        $group: {
          _id: &quot;$user&quot;,
        },
      },
    ]);
    res.status(200).json({ status: true, data: result });
  } catch (error) {
    res.status(200).json({ status: false, data: error.message });
  }
};
</code></pre>
<p>A sample cart model data is below</p>
<pre><code>{
  &quot;_id&quot;: {
    &quot;$oid&quot;: &quot;6592be024fc8de3f1771a9e1&quot;
  },
  &quot;product&quot;: {
    &quot;$oid&quot;: &quot;657fab1586f102e3657bf034&quot;
  },
  &quot;user&quot;: {
    &quot;$oid&quot;: &quot;6559696bfa9b7df357161a81&quot;
  },
  &quot;createdAt&quot;: {
    &quot;$date&quot;: &quot;2024-01-01T13:28:34.452Z&quot;
  },
  &quot;unit&quot;: 4,
  &quot;updatedAt&quot;: {
    &quot;$date&quot;: &quot;2024-01-01T13:28:46.865Z&quot;
  }
},
{
  &quot;_id&quot;: {
    &quot;$oid&quot;: &quot;6592dc014fc8de3f1771bc3f&quot;
  },
  &quot;product&quot;: {
    &quot;$oid&quot;: &quot;65801d5e2c366e8773ada21f&quot;
  },
  &quot;user&quot;: {
    &quot;$oid&quot;: &quot;6559696bfa9b7df357161a81&quot;
  },
  &quot;createdAt&quot;: {
    &quot;$date&quot;: &quot;2024-01-01T15:36:33.420Z&quot;
  },
  &quot;unit&quot;: 3,
  &quot;updatedAt&quot;: {
    &quot;$date&quot;: &quot;2024-01-01T15:36:37.161Z&quot;
  }
}
</code></pre>
<p>Could someone provide guidance or an example of an aggregation query that retrieves the specified information from multiple collections (Cart, User, and Product) in a format suitable for mapping in React? Any help or suggestions would be greatly appreciated. Thank you!</p>

