<p>This is how I’m creating it:</p>
<pre><code>await users.updateMany(
  { email: user.email },
  { $push: { campaigns: { name: campaignname, type, leads: [] } } }
);
</code></pre>
<p>Now what I want to do is “add” some data(array of objects) to the “leads” array with a specified campaign name.</p>
<p>So I essentially want to search for user, select the campaign inside the campaigns array by the “name” field and push the array of objects inside the “leads” array.</p>
<p>I tried:</p>
<pre><code>await users.updateOne({
  $push: {
    &quot;campaigns.$[elem].leads&quot;: { $each: leads }
  }
},
{
  arrayFilters: [
    {
      &quot;elem.name&quot;: campaignname
    }
  ]
})
</code></pre>
<p>Doesn't work</p>
<p>Please anyone help promptly</p>

