I need help to Aggregate for mongoDb Chat App to receive latest message from each related chat<p>I'm making a chat app, and there will be only one conversation between two person so I didn't make conversation table or ID and the way I want to show list of chats to clients will be like this:</p>
<p>I will get the latest message related to each conversation, conversations are filtered by sender/receiver ID's,</p>
<p>So if there is 2 message in database and the first one has this data :</p>
<pre class="lang-js prettyprint-override"><code>{
    sender: &quot;User.x.ID&quot;,
    receiver: &quot;User.y.ID&quot;,
    msg: &quot;How are you?&quot;,
},
{
    sender: &quot;User.y.ID&quot;,
    receiver: &quot;User.x.ID&quot;,
    msg: &quot;Good thanks, and you?&quot;,
},
</code></pre>
<p>The latest message will be <code>&quot;Good thanks, and you?&quot;</code></p>
<p>This my <code>messageSchema</code>:</p>
<pre class="lang-js prettyprint-override"><code>{
    sender: {
        type: mongoose.Schema.Types.ObjectId,
        ref: &quot;User&quot;,
    },
    receiver: {
        type: mongoose.Schema.Types.ObjectId,
        ref: &quot;User&quot;,
    },
    usersRelated: {
        type: Array,
    },
    msg: {
        type: String,
    }
}
</code></pre>
<p>This is my code:</p>
<pre class="lang-js prettyprint-override"><code>const Chats = await Message.aggregate([
    { $sort: { createdAt: -1 } },
    {
        $match: {
            $expr: {
                usersRelated: [req.user.id],
            },
        },
    },
    {
        $group: {
            _id: {
                sender: &quot;$sender&quot;,
                receiver: &quot;$receiver&quot;,
            },
            messages: {
                $top: {
                    sortBy: { createdAt: -1 },
                    output: &quot;$$ROOT&quot;,
                },
            },
        },
    },
    { $replaceWith: &quot;$messages&quot; },
])
</code></pre>
<p>And it returns both of the messages which I don't want, I only want the latest message which will be : <code>&quot;Good thanks, and you?&quot;</code>.</p>
<p>The reason behind of my need is :</p>
<p>I am trying to show the lists of chats with the preview of latest message same as most of chat apps.</p>
<p>So if you are logged in as <code>User X</code> what you will see in your list of chat will be one chat with <code>User Y</code> and they responded to you: <code>&quot;Good thanks, and you?&quot;</code> and if you click on the chat, then I will load all of the messages related to this two user which will be like this :</p>
<pre class="lang-none prettyprint-override"><code>User X said : How are you?

User Y Said : Good thanks, and you?
</code></pre>

