How to unwind subdocument array, and then reverse the process, without losing other keys?<p>I'm completely new to Mongoose.</p>
<p>I have this Schema:</p>
<pre><code>const houseSchema = new mongoose.Schema({  
  _id: String,
  housename:  {type: String,unique: true},
  adress: String,
  people: [ {
      name: String,
      age: Number
    } ],
});
</code></pre>
<p>And document:</p>
<pre><code> let house = new House({
    _id: 20,
    housename: &quot;white&quot;,
    adress: &quot;St1&quot;,
    people:[
      {name: &quot;Jon&quot;, age: 23},
      {name: &quot;Ann&quot;, age:50},
      {name: &quot;Pat&quot;, age:20},
      {name: &quot;Helen&quot;, age:15}]
  });
</code></pre>
<p>I want to find this document by id, and filter people array by age, then return full document without filtered objects. So expected output would be: (for age&gt;21 ):</p>
<pre><code>{
    _id: 20,
    housename: &quot;white&quot;,
    adress: &quot;St1&quot;,
    people:[
      {_id:&quot;65976faeaa644d02c4090826&quot;, name: &quot;Jon&quot;, age: 23},
      {_id:&quot;65976faeaa644d02c4090827&quot;, name: &quot;Ann&quot;, age:50}
    ]
 }
</code></pre>
<p>My solution to this problem, after hours of trying is:</p>
<pre><code>app.get(&quot;/api/test&quot;, (req, res) =&gt; {
  var searchID = &quot;20&quot;;
  var minAge = 21;
  House.aggregate([{$match: {_id: searchID}}])
  .unwind(&quot;people&quot;).match({'people.age': {$gt: minAge}})
  .group({    
        _id: &quot;$_id&quot;,       
        people: {$push: &quot;$people&quot;}         
  }) 
  .exec((err,data)=&gt;{
        res.json(data); 
    }); 
});
</code></pre>
<p>So first I match id, then rewind people array - so I can filter it out, and then I try to rejoin to the first form. <strong>However after grouping I lose <em>housename</em> and <em>adress</em> fields.</strong> Here is output:</p>
<pre><code>{&quot;_id&quot;:&quot;20&quot;,
&quot;people&quot;:[
